import classes from './ListDropdown.module.css';
import React from "react";

//style={{ width: "10px", height: "4px", border:'1px solid red' }}



const ListDropdown = (props) => {
    console.log(props);
    let  DropdownLi = props.menuSidebar.map(e=> {
            {
                if (e.label === 'services') {
                    <details key={e.id}>
                        <summary>
                            <a className={classes.active} href={e.url}>{e.label}</a>
                        </summary>
                    </details>
                } else {
                    <li key={e.id}>
                        <a className={classes.active} href={e.url}>{e.label}</a>
                    </li>

                }
            }
        }
    );




    let  DropdownList = props.menuData.map(e=>
        <li key={e.id} className={classes.li_dropdoun}>
            <a href={e.url}>{e.label}</a>
        </li>
    );

    return(
        <div className={classes.menuSidebar} >
            <ul className={classes.sidebar}>
                {DropdownLi}
            </ul>
            <ul className={classes.ul_dropdoun} >
                {DropdownList}
            </ul>
        </div>

    );

};

export default ListDropdown;
